import React from 'react';
import { Collapse, Button } from 'react-bootstrap';
import Fields from './fieldset.jsx';
import styles from './workspace.module.css';

const Workspace = ({exploreOpen, handlePlus, counter}) => {

    const datafield  =[{"box1":<input type="text" value="" />,
                        "box2":  <input type="text" value="" />,
                        "box3":  <input type="text" value="" />,
                        "box4":  <input type="text" value="" />,
    }];
 const equal = "="
 const multiple = "X"
 const plus = "+"


    return ( 
        <div>
                <Collapse in={exploreOpen}>
                   <div id="example-collapse-text"  className={styles.formwrap}>
                     <Button onClick ={() => handlePlus()}>Plus</Button>

                        {datafield.map((d, idx)=>{
                                return (<Fields key={idx}>{d.box1}{equal}{d.box2}{multiple}{d.box3}{plus}{d.box4}</Fields>)
                            })}

                   </div>
          </Collapse>
        </div>
     )
   };
   
   export default Workspace;
